From the back of the DVD case: 

Rising Up, a ground-breaking and award-winning 'documentary', tells the story of the oft-neglected zombie rights movement of the 1960s. In the early part of the 20th century, zombies were killed for assembling in public, exploited as crash test dummies and abused by the cosmetics industry. Few people knew about their plight, and even fewer cared. 

Through contemporary interviews and historical footage, Rising Up takes us from the movement's humble origins in the beatnik communities of Pittsburgh to the height of its popularity where zombies, human protesters and an enigmatic leader take Washington by storm.

Rising Up is narrated by Phil Lamar (Pulp Fiction, Futurama) and stars Kevin Allison (MTV's The State), Rae C Wright, Stu Richel and Kirk Larsen.
